description:
June 6, 2016 / Rabia interviews Congressman Keith Ellison,  representative for the 5th Congressional District of Minnesota. Check out Rep. Ellison's podcast, We The Podcast, at https://itunes.apple.com/us/podcast/we-the-podcast/id958234911?mt=2. His twitter feed is available at https://twitter.com/keithellison.&#13;
&#13;
Episode scoring music by Alex Fitch, AnimalWeapon, Blue Dot Sessions, Chris Zabriskie, Julian Sartorius, and Uncanny Valleys

